import './StyleHeader.css';
import React from 'react';

const Header = ()=>{
    return <div className='header'>
      <div className='divForBut'></div>
      <div className='divForTag'></div>
      <div className='divForName'></div>
      <div className='divForPhoneNumb'></div>
    </div>
}

export default Header;
